import React from 'react';

interface PreviewProps {
  tileStyles: React.CSSProperties;
}

const Preview: React.FC<PreviewProps> = ({ tileStyles }) => {
  const gridTiles = Array.from({ length: 9 }).map((_, index) => (
    <div key={index} className="preview-tile" style={tileStyles}></div>
  ));

  return (
    <div className="preview-section">
      <div className="preview-container">
        <h3>1x1 Tile</h3>
        <div className="preview-tile single-tile" style={tileStyles}></div>
      </div>
      <div className="preview-container">
        <h3>3x3 Grid</h3>
        <div className="preview-grid" style={{gridTemplateColumns: 'repeat(3, 1fr)'}}>{gridTiles}</div>
      </div>
    </div>
  );
};

export default Preview;
